// /components/Dashboard.js
import React from 'react';
import IncidentCard from './IncidentCard';
import { Container, Row, Col, Button } from 'react-bootstrap';

const Dashboard = () => {
  return (
    <Container className="my-4">
      <h2>Hello, Lana</h2>
      <Button variant="outline-dark" className="my-3">Report It, Now!</Button>
      <Row>
        <Col><IncidentCard title="Title of the incident" status="Pending" /></Col>
        <Col><IncidentCard title="Title of the incident" status="In-Process" /></Col>
        <Col><IncidentCard title="Title of the incident" status="Complete" /></Col>
      </Row>
    </Container>
  );
};

export default Dashboard;
